import React from 'react'
import { navigations } from '../../utils/utils'
import { Link } from 'react-router-dom'

const Navbar=()=>{
    return(
        <nav>
            {
                navigations.map((nav)=>(
                    <nav key={nav.id}>
                        <Link to={nav.links} />
                        </nav>
                ))
            }
        </nav>
    )
}

export default Navbar
